def main():
	print('Choose the Dataset you want to run on:')
	print('1 for random dataset,')
	print('2 for Iris dataset,')
	print('3 for Pima dataset,')
	print('4 for Balance dataset,')
	print('5 for Bupa dataset,')
	print('6 for haberman dataset,')

	dataset = int(input('Enter 1 or 2 or 3 or 4 or 5 or 6: '))
	if dataset == 1:
		k_times, logk_times = get_random_runtime()
	elif dataset == 2:
		k_times, logk_times = get_iris_runtime()
	elif dataset == 3:
		k_times, logk_times = get_pima_runtime()
	elif dataset == 4:
		k_times, logk_times = get_balance_runtime()
	elif dataset == 5:
		k_times, logk_times = get_bupa_runtime()
	elif dataset == 6:
		k_times, logk_times = get_haberman_runtime()

	K = np.arange(10,len(k_times)+10,1)
	n_times = []
	logn_times = []
	for k in K:
		n_times.append(0.12*k)
		logn_times.append(np.log(k))

	plt.plot(K,k_times, label='Algo A runtime')
	plt.plot(K,logk_times, label='Algo B runtime')
	if dataset == 1:
		plt.plot(K,n_times, label='O(n)')
		plt.plot(K,logn_times, label='O(log n)')
	plt.xlabel('n')
	plt.ylabel('time (sec)')
	plt.legend(loc="upper left")
	plt.title("Runtime Comparison Between Algo A & B")
	plt.show()


if __name__ == "__main__":
	main()